contracts/21-fixed-and-dynamic-bytes.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;

contract bytesDeclaration {
    // üîπ State-level declarations üîπ

    // ‚úÖ Fixed-size value type (stored directly) ‚Äî NO memory keyword needed
    bytes1 public fixedByte1 = 0xAA;
    bytes4 public fixedByte4 = 0x12345678;
    bytes32 public fixedByte32;

    // ‚úÖ Dynamic-size reference type ‚Äî Stored in storage ‚Äî memory not needed here
    bytes public dynamicBytes1 = "Hello";
    bytes public dynamicBytes2;

    function bytesInFunction(uint256 len) public pure returns (bytes memory, bytes1) {
        // üî∏ Fixed-size value type ‚Äî No memory needed
        bytes1 b1 = 0xFF;

        // üî∏ Dynamic bytes ‚Äî Reference type ‚Äî MUST use memory
        bytes memory dyn1 = new bytes(len); // ‚úÖ OK

        // ‚ùå Error: memory keyword is required
        // bytes dyn2 = new bytes(len); // ‚ùå Invalid: Data location must be "memory"

        return (dyn1, b1);
    }

    function bytesStorageReference() public view returns (bytes memory, bytes1) {
        // üî∏ Memory copy of state dynamic bytes ‚Äî Required memory keyword
        bytes memory tempCopy = dynamicBytes1;

        // üî∏ Fixed bytes ‚Äî direct value return
        bytes1 val = fixedByte1;

        return (tempCopy, val);
    }

    function deleteBytesExamples() public {
        // ‚úÖ Delete fixed-size value type (sets to 0x00)
        delete fixedByte1;

        // ‚úÖ Delete dynamic bytes (clears content)
        delete dynamicBytes1;
    }
}

